{}; // Ici, le module exporte via un retour de fonction, les valeurs souhaitées. }); \\n\\nOn pourrait croire que tout est bien qui fini bien, mais il nous reste un gros\\nproblème à résoudre. Comment utiliser les modules AMD avec NodeJS et vice-versa\\n? Il existe plusieurs solutions [http://www.2ality.com/2011/11/module-gap.html]\\npour rendre inter-compatibles les différents modules, mais cela reste une sorte\\nde tambouille incompréhensible. D\'ailleurs, je serais ravi d\'avoir vos bonnes\\npratiques en la matière.\\n\\nEdit : On me souffle dans l\'oreille\\n[https://twitter.com/_Florian_R/status/236437043004207104]que require.js est\\nutilisable avec NodeJs, un petit lot de consolation donc ;).\\n\\nECMASCRIPT 6 : LA LUMIÈRE AU BOUT DU TUNNEL\\nGrâce à la dernière mouture d\'ECMAScript (aussi appelé ECMAScript.next) le\\nstandard qui sous tend Javascript, un gestionnaire natif de modules Javascript\\nsera disponible. Malheureusement, on ne peut faire aucune prévision en ce qui\\nconcerne le jour où il sera envisageable d\'utiliser ce dernier étant donné qu\'il\\nfaudra que tous les principaux navigateurs du marché l\'aient implémenté. En ce\\nqui concerne NodeJs, étant donné qu\'il est basé sur le moteur javascript V8 de\\nGoogle Chrome, son implémentation sera sûrement conditionnée à celle de Google\\nChrome.\\n\\nL\'approche de la nouvelle version de Javascript est simple, le mot clé export\\npermet de déclarer une fonction comme devant être exportée ou d\'énumérer les\\nvariables devant être exportée.\\n\\nvar a=1, b=2, c=3;\\n export a, b, c;\\nexport function() {};\\n\\nVoilà, vivement que nous puissions enfin utiliser cette version de Javascript et\\nrésoudre tous nos problèmes de compatibilité de modules. Vos précisions ou\\ncommentaires sont les bienvenus.\\n\\n< Blog [/fr/blog/index.html] Please enable JavaScript to view the comments\\npowered by Disqus. [https://disqus.com/?ref_noscript] Twitter\\n[https://twitter.com/nfroidure] GitHub [https://github.com/nfroidure] NPM\\n[https://www.npmjs.org/~nfroidure] LinkedIn\\n[https://www.linkedin.com/in/nfroidure] ATOM feed [/fr/blog/index.atom] ©\\nNicolas Froidure 2012-2021"}'),doc131:JSON.parse('{"path":"contents/pages/fr/blog/nommenclature_table_sql_base.html","title":"Conventions de nommage des bases de données","description":"Depuis que j\'ai découvert les bases de données avec MySQL, je n\'ai pas cessé de m\'en servir, tant et si bien que j\'ai fini par définir une convention de nommage.","shortTitle":"Convention de nommage SQL","shortDesc":"En savoir plus sur la convention de nommage que j\'utilise","contents":"  LOGO INSERT AFTER [/IMAGES/LOGO.SVG] [/FR/INDEX.HTML]\\nAccueil [/fr/index.html] Home [/en/index.html]  *  Accueil [/fr/index.html] \\n *  Blog [/fr/blog/index.html] \\n *  Projets [/fr/projets.html] \\n *  À propos [/fr/a_propos.html] \\n\\nCONVENTIONS DE NOMMAGE DES BASES DE DONNÉES\\nDepuis que j\'ai découvert les bases de données avec MySQL, je n\'ai pas cessé de\\nm\'en servir, tant et si bien que j\'ai fini par définir une convention de\\nnommage.\\n\\nJe suis actuellement en pleine lecture du livre Bases de données : Concepts,\\nutilisation et développement de Jean-Luc Hainaut. J\'en ferai la critique sur ce\\nmême blog, pour l\'instant mon impression est plutôt bonne.\\n\\nEn revanche, il y a une chose qui m\'exaspère au plus haut point dans ce livre :\\nle manque d\'uniformité et de clarté dans les appellations des bases et des\\nchamps. Tout est en majuscule (argh !), en français (ouch !) et les clés\\nprimaires auto incrémentées sont nommées comme suit : NCOM, NCLI, NPRO. Ce n\'est\\npas vraiment l\'idéal.\\n\\nAu fil de mon utilisation des bases de données, j\'ai normalisé ma façon de les\\nnommer de manière à ce que l\'on puisse facilement comprendre les requêtes que je\\nrédige. Je vous livre donc ma méthode afin que les plus fainéants d\'entre vous\\nn\'aient pas à y réflechir, mais simplement à l\'appliquer.\\n\\nRÈGLES DE BASE\\nEnglish everywhere. Quel est le sens de nommer ses bases, tables ou champs en\\nfrançais alors que :\\n\\n * la langue des programmeurs est l\'anglais;\\n * rien ne dit qu\'un projet ne s\'internationalisera pas durant son cycle de vie\\n   ou que l\'entreprise ne devienne pas une multinationale entre temps; \\n * l\'anglais est simple, n\'a pas d\'accents donc pas de source d\'erreurs du genre\\n   : comment savoir si la table colles fait référence aux collés du collège du\\n   coin ou aux tubes de colle en réserve ? \\n * Le langage SQL est en anglais, nommer ses tables en français est un curieux\\n   mélange des genres, nécessitant de switcher de français à anglais en\\n   permanence. \\n\\nUtilisation du snake case (ndr: et non camelCase comme initialement recommandé\\nici, MySQL est sensible à la casse, mais ce n\'est pas le cas de PostgreSQL, le\\nsnake case est donc plus largement utilisable partout).\\nLe snake case (ex: an_example_snake_case) rend plus lisible les noms des tables\\nen marquant les différents mots qui composent le nom d\'une table apportant une\\nvisibilité qui n\'est pas de trop pour les requêtes les plus complexes. De plus\\ncette syntaxe est assez naturelle à tout programmeur initié à la programmation\\nen C ou en Rust.\\n\\nCes deux règles suffisent à savoir comment nommer une base de donnée, pour les\\ntables, c\'est un peu plus complexe.\\n\\nNOMENCLATURE DES TABLES\\nJe nomme toutes les tables au pluriel selon un postulat simple : les tables sont\\nune liste de lignes. C\'est aussi une façon de bien distinguer une table d\'une\\ntable liée. Par exemple, grâce à l\'utilisation du pluriel, on ne peut pas\\nconfondre la table products avec la table product_categories ou le champ \\nbill_rows.product.\\n\\nSeules les tables de jointures peuvent contenir (elles le doivent) deux tirets à\\nla suite. Plus précisément l\'underscore (tiret sous le 8 sur votre clavier). Une\\ntable qui associerai des utilisateurs à leurs produits préférés se nommerai \\nproducts__users.\\n\\nC\'est une convention personnelle mais qui peut avoir de l\'importance : le nom de\\nla table products__users doit être composée des deux tables qu\'elle référence\\npar ordre alphabétique croissant. Cela permet de pouvoir prédire leur nom sans\\navoir besoin de consulter le schéma de la table.\\n\\nNOMENCLATURE DES CHAMPS\\nLes champs sont le plus souvent au singulier lorsqu\'il ne peuvent contenir\\nqu\'une valeur. Une exception cependant, les champs de type SET qui contiennent\\nun sous ensemble du set de valeurs qu\'il peuvent contenir (avec PostgreSQL, ce\\nsont les champs de type Array).\\n\\nCela permet aussi de se poser une question sur le contenu de votre table. Si\\nl\'un des champs est au pluriel et n\'est pas de type SET, il y a de fortes\\nprésomptions sur le fait que le schéma de votre table n\'est pas optimal\\nconceptuellement.\\n\\nBien entendu, un champs avec une clé étrangère référençant la table products \\nsera nommé product si possible.\\n\\nEnfin, l\'identifiant unique quand il se résume à une seule valeur\\nauto-incrémentée (90% des cas) sera nommé simplement id.\\n\\nET AU NIVEAU DES REQUÊTES ?\\nEn revanche, pour mes requêtes, j\'utilise les majuscules, distinguant ainsi les\\nparties propres au language des noms des tables et champs. Voici une requête\\ncréée récemment pour l\'export CSV d\'un client:\\n\\nSELECT\\n  equipments.id AS Id,\\n  organizations.label AS Client,\\n  installations.label AS Aire,\\n  CONCAT_WS(\' \', equipment_models.model,\\n  equipments.precision) AS Jeu\\nFROM equipments\\nLEFT JOIN equipment_models\\n  ON equipments.model = equipment_models.id\\nLEFT JOIN installations\\n  ON equipments.installation = installations.id\\nLEFT JOIN organizations\\n  ON installations.organization = organizations.id\\nWHERE equipment_models.model LIKE \'%sans réf%\'\\n\\nVoilà pour mes petites règles de bonne conduite SQL ! Et vous, comment\\nnommez-vous vos tables ? Que pensez-vous de ces principes ?\\n\\n< Blog [/fr/blog/index.html] Please enable JavaScript to view the comments\\npowered by Disqus. [https://disqus.com/?ref_noscript] Twitter\\n[https://twitter.com/nfroidure] GitHub [https://github.com/nfroidure] NPM\\n[https://www.npmjs.org/~nfroidure] LinkedIn\\n[https://www.linkedin.com/in/nfroidure] ATOM feed [/fr/blog/index.atom] ©\\nNicolas Froidure 2012-2021"}'),doc132:JSON.parse('{"path":"contents/pages/articles-nommenclature_table_sql_base.html","title":"Conventions de nommage des bases de données","description":"Depuis que j\'ai découvert les bases de données avec MySQL, je n\'ai pas cessé de m\'en servir, tant et si bien que j\'ai fini par définir une convention de nommage.","shortTitle":"Convention de nommage SQL","shortDesc":"En savoir plus sur la convention de nommage que j\'utilise","contents":"  LOGO INSERT AFTER [/IMAGES/LOGO.SVG] [/FR/INDEX.HTML]\\nAccueil [/fr/index.html] Home [/en/index.html]  *  Accueil [/fr/index.html] \\n *  Blog [/fr/blog/index.html] \\n *  Projets [/fr/projets.html] \\n *  À propos [/fr/a_propos.html] \\n\\nCONVENTIONS DE NOMMAGE DES BASES DE DONNÉES\\nDepuis que j\'ai découvert les bases de données avec MySQL, je n\'ai pas cessé de\\nm\'en servir, tant et si bien que j\'ai fini par définir une convention de\\nnommage.\\n\\nJe suis actuellement en pleine lecture du livre Bases de données : Concepts,\\nutilisation et développement de Jean-Luc Hainaut. J\'en ferai la critique sur ce\\nmême blog, pour l\'instant mon impression est plutôt bonne.\\n\\nEn revanche, il y a une chose qui m\'exaspère au plus haut point dans ce livre :\\nle manque d\'uniformité et de clarté dans les appellations des bases et des\\nchamps. Tout est en majuscule (argh !), en français (ouch !) et les clés\\nprimaires auto incrémentées sont nommées comme suit : NCOM, NCLI, NPRO. Ce n\'est\\npas vraiment l\'idéal.\\n\\nAu fil de mon utilisation des bases de données, j\'ai normalisé ma façon de les\\nnommer de manière à ce que l\'on puisse facilement comprendre les requêtes que je\\nrédige. Je vous livre donc ma méthode afin que les plus fainéants d\'entre vous\\nn\'aient pas à y réflechir, mais simplement à l\'appliquer.\\n\\nRÈGLES DE BASE\\nEnglish everywhere. Quel est le sens de nommer ses bases, tables ou champs en\\nfrançais alors que :\\n\\n * la langue des programmeurs est l\'anglais;\\n * rien ne dit qu\'un projet ne s\'internationalisera pas durant son cycle de vie\\n   ou que l\'entreprise ne devienne pas une multinationale entre temps; \\n * l\'anglais est simple, n\'a pas d\'accents donc pas de source d\'erreurs du genre\\n   : comment savoir si la table colles fait référence aux collés du collège du\\n   coin ou aux tubes de colle en réserve ? \\n * Le langage SQL est en anglais, nommer ses tables en français est un curieux\\n   mélange des genres, nécessitant de switcher de français à anglais en\\n   permanence. \\n\\nUtilisation du snake case (ndr: et non camelCase comme initialement recommandé\\nici, MySQL est sensible à la casse, mais ce n\'est pas le cas de PostgreSQL, le\\nsnake case est donc plus largement utilisable partout).\\nLe snake case (ex: an_example_snake_case) rend plus lisible les noms des tables\\nen marquant les différents mots qui composent le nom d\'une table apportant une\\nvisibilité qui n\'est pas de trop pour les requêtes les plus complexes. De plus\\ncette syntaxe est assez naturelle à tout programmeur initié à la programmation\\nen C ou en Rust.\\n\\nCes deux règles suffisent à savoir comment nommer une base de donnée, pour les\\ntables, c\'est un peu plus complexe.\\n\\nNOMENCLATURE DES TABLES\\nJe nomme toutes les tables au pluriel selon un postulat simple : les tables sont\\nune liste de lignes. C\'est aussi une façon de bien distinguer une table d\'une\\ntable liée. Par exemple, grâce à l\'utilisation du pluriel, on ne peut pas\\nconfondre la table products avec la table product_categories ou le champ \\nbill_rows.product.\\n\\nSeules les tables de jointures peuvent contenir (elles le doivent) deux tirets à\\nla suite. Plus précisément l\'underscore (tiret sous le 8 sur votre clavier). Une\\ntable qui associerai des utilisateurs à leurs produits préférés se nommerai \\nproducts__users.\\n\\nC\'est une convention personnelle mais qui peut avoir de l\'importance : le nom de\\nla table products__users doit être composée des deux tables qu\'elle référence\\npar ordre alphabétique croissant. Cela permet de pouvoir prédire leur nom sans\\navoir besoin de consulter le schéma de la table.\\n\\nNOMENCLATURE DES CHAMPS\\nLes champs sont le plus souvent au singulier lorsqu\'il ne peuvent contenir\\nqu\'une valeur. Une exception cependant, les champs de type SET qui contiennent\\nun sous ensemble du set de valeurs qu\'il peuvent contenir (avec PostgreSQL, ce\\nsont les champs de type Array).\\n\\nCela permet aussi de se poser une question sur le contenu de votre table. Si\\nl\'un des champs est au pluriel et n\'est pas de type SET, il y a de fortes\\nprésomptions sur le fait que le schéma de votre table n\'est pas optimal\\nconceptuellement.\\n\\nBien entendu, un champs avec une clé étrangère référençant la table products \\nsera nommé product si possible.\\n\\nEnfin, l\'identifiant unique quand il se résume à une seule valeur\\nauto-incrémentée (90% des cas) sera nommé simplement id.\\n\\nET AU NIVEAU DES REQUÊTES ?\\nEn revanche, pour mes requêtes, j\'utilise les majuscules, distinguant ainsi les\\nparties propres au language des noms des tables et champs. Voici une requête\\ncréée récemment pour l\'export CSV d\'un client:\\n\\nSELECT\\n  equipments.id AS Id,\\n  organizations.label AS Client,\\n  installations.label AS Aire,\\n  CONCAT_WS(\' \', equipment_models.model,\\n  equipments.precision) AS Jeu\\nFROM equipments\\nLEFT JOIN equipment_models\\n  ON equipments.model = equipment_models.id\\nLEFT JOIN installations\\n  ON equipments.installation = installations.id\\nLEFT JOIN organizations\\n  ON installations.organization = organizations.id\\nWHERE equipment_models.model LIKE \'%sans réf%\'\\n\\nVoilà pour mes petites règles de bonne conduite SQL ! Et vous, comment\\nnommez-vous vos tables ? Que pensez-vous de ces principes ?\\n\\n< Blog [/fr/blog/index.html] Please enable JavaScript to view the comments\\npowered by Disqus. [https://disqus.com/?ref_noscript] Twitter\\n[https://twitter.com/nfroidure] GitHub [https://github.com/nfroidure] NPM\\n[https://www.npmjs.org/~nfroidure] LinkedIn\\n[https://www.linkedin.com/in/nfroidure] ATOM feed [/fr/blog/index.atom] ©\\nNicolas Froidure 2012-2021"}'),doc133:JSON.parse('{"path":"contents/pages/fr/blog/normalisation_retours_json.html","title":"Normalisation des retours JSON","description":"Peu de gens pensent à normaliser les JSON en début de\\n projet. C\'est dommage car c\'est le meilleur moment pour.","shortTitle":"Normalisation JSON","shortDesc":"Voir comment créer des JSON qui roxxent","contents":"  LOGO INSERT AFTER [/IMAGES/LOGO.SVG] [/FR/INDEX.HTML]\\nAccueil [/fr/index.html] Home [/en/index.html]  *  Accueil [/fr/index.html] \\n *  Blog [/fr/blog/index.html] \\n *  Projets [/fr/projets.html] \\n *  À propos [/fr/a_propos.html] \\n\\nNORMALISATION DES RETOURS JSON\\n TL; DR:\\n\\n{\\n  items: [1, 2, ...otherUsersIds],\\n  users: {\\n    \'1\' : {\\n      content: {\\n        id: 1,\\n        name: \'Popol\',\\n        organization_id: 1\\n      },\\n      avatarURL: \'//img.ur/trololol.png\'\\n    },\\n    ...otherUsers\\n  },\\n  organisations: {\\n    \'1\': {\\n      content: {\\n        id: 1,\\n        name: \'Popol inc.\',\\n        owner_id: 1\\n      }\\n    }\\n  }\\n}\\n  \\n\\n\\n\\nCela fait un moment que je souhaite écrire ce billet, notamment à l\'usage de\\nréférence pour les personnes à qui je parle de ma façon de designer les retours\\nde mes APIs.\\n\\nSi vous n\'avez pas ragequit ce blog à la suite de son TL;DR, laissez moi vous\\nexpliquer pourquoi j\'ai fini par utiliser cette structure pour mes retours JSON.\\n\\nNORMALISATION\\nÀ ne pas confondre avec standardisation ou structuration. Ici, j\'entends le\\nterme normalisation comme on l\'entendrait dans une base de donnée relationnelle\\nmais pour un seul retour JSON.\\n\\nSouvent, dans de nombreuses API, la décision est prise d\'embarquer des\\nressources relatives à une ressource retournée par un point d\'API. Par exemple,\\nun GET /users/:userId pourrait retourner aussi l\'organisation ou les\\norganisations de ce dernier.\\n\\nCertains diront que c\'est le moment où il faut envisager d\'utiliser GraphQL. Je\\nne serais pas aussi catégorique. Je ne vois pas de souci majeur à ajuster\\nlégèrement un retour pour apporter des informations supplémentaires. Après tout\\nles principes RESTful autorisent plusieurs représentations d\'une même ressource\\ndonc pourquoi s\'en priver ?\\n\\nEn revanche, l\'erreur à ne pas commettre est d\'embarquer les ressources liées\\ndirectement comme propriété de ce dernier. En effet, ceci a pour effet que si\\ndeux utilisateurs ont la même organisation, celle-ci se retrouve en double dans\\nle retour JSON.\\n\\nVous comprenez donc certainement mieux le TL;DR de ce billet. La structure que\\nj\'utilise dans mes JSON permet d\'éviter ce problème.\\n\\nVous remarquerez également que la liste des items d\'une collection n\'est pas\\ndirectement dans la collection, mais seuls leurs identifiants apparaissent. La\\nraison est que cela permet d\'avoir des collections qui se répètent. Par exemple,\\nun point d\'API GET /usersQueue pourrait lister plusieurs fois le même\\nutilisateur car ce dernier aurait réservé plusieurs slots dans une file\\nd\'attente. Autre avantage, le user propriétaire de l\'organisation de mon exemple\\npeut être retrouvé facilement dans le JSON.\\n\\nVous pourriez me rétorquer “Et pourquoi pas JSON Reference ?”. Pour rappel, JSON\\nreference [https://tools.ietf.org/html/draft-pbryan-zyp-json-ref-03]est une\\nspécification qui vise à pouvoir utiliser des références à d\'autres valeurs du\\nJSON lui-même afin de pouvoir créer des références circulaires.\\n\\nTrois raisons m\'en empêchent :\\n\\n * la première est que je souhaite pouvoir désérialiser mes JSON avec le parseur\\n   natif sur tous les navigateurs. Cela, bien entendu, pour des raisons de\\n   performances. Un navigateur passe son temps à désérialiser du JSON, il est\\n   donc hors de question de faire cela en JS avec un polyfill de JSON reference; \\n * la seconde est que je veux également pouvoir croiser mes objets de façon\\n   transversale. En maintenant des stores d\'objets je peux dupliquer les\\n   références sur toute mon application et ainsi optimiser la consommation\\n   mémoire de l\'application entière. Avec ce format, un simple Object.assign \\n   dans mon wrapper d\'API [./generation_api_cliente.html] suffit; \\n * la dernière est que je ne veux pas polluer mes objets, ce qui me permet de\\n   transitionner en douceur sur le point suivant. \\n\\nSÉGRÉGATION\\nEn général, la représentation d\'une ressource contient deux sortes\\nd\'informations. Les données normalisées (encore ;)) sont souvent stockées dans\\nla base de données. Il s\'agit de l\'essence de la ressource. C\'est souvent sur\\nces données que votre CRUD va agir dans une application. C\'est également\\ncelle-là que vos appels PUT enverront.\\n\\nC\'est pour cela que je les ségrègue dans une propriété content. La convention\\nest que son contenu est ce qui peut-être modifié directement par les\\nutilisateurs. Ainsi, pas de filtre à appliquer, dans le front pour extraire les\\ndonnées modifiables.\\n\\nLe second type de données sont ce que j\'appelle les données calculées. Ces\\ndernières sont utiles uniquement pour l\'affichage de la ressource et ne peuvent\\nêtre modifiées directement. C\'est le cas du lien d\'avatar dans mon exemple, mais\\nc\'est aussi le cas des dates d\'enregistrement dans les bases de données.\\n\\nCOMPOSITION DES JSON SCHEMAS\\nJ\'aime beaucoup JSON Schema mais il faut bien l\'avouer : rien n\'est plus\\nsaoulant que de les définir. Cette façon de faire permet de réutiliser les\\ndéfinitions simplement afin de construire sa définition Swagger de façon la\\nmoins répétitive possible. Voici comment je définirai le JSON Schema de la\\nreprésentation utilisée en fil rouge de ce billet :\\n\\n\\n  const userSchema = require(\'user\');\\n  const organizationSchema = require(\'organization\');\\n  const { idSchema, idPattern } = require(\'utils\');\\n\\n  module.exports = {\\n    title: \'Users collection\',\\n    type: \'object\',\\n    additionalProperties: false,\\n    properties: {\\n      items: {\\n        title: \'User\\\\\'s identifiers for the queried collection.\',\\n        type: \'array\',\\n        items: idSchema,\\n      },\\n      users: {\\n        title: \'Users hash\',\\n        description: \'A hash containing users in the items collection.\',\\n        type: \'object\',\\n        patternProperties: {\\n          idPattern: userSchema,\\n        }\\n      },\\n      organizations: {\\n        title: \'Organizations hash\',\\n        description: \'A hash containing organizations linked to users in the collection.\',\\n        type: \'object\',\\n        patternProperties: {\\n          idPattern: organizationSchema,\\n        },\\n      },\\n    },\\n  };\\n\\n\\nEt voilà ;). Vous savez tout ! N\'hésitez pas à me fournir vos astuces\\npersonnelles pour structurer et normaliser vos retours JSON !\\n\\n Ajout de dernière minute :\\nKévin Dunglas, un nordiste très actif dans les communautés PHP/REST a cité sur\\nTwitter les standards suivants comme substitutifs à la structure présentée dans\\ncet article :\\n\\n *  JSON-LD : [http://json-ld.org/] une alternative à l\'utilisation de JSON\\n   Reference cité ci-dessus. Je n\'ai pas choisi ce format car pour moi il\\n   mélange définition des données avec les données elle-mêmes. Au delà de\\n   l\'overhead en taille causé par l\'utilisation des URIs en lieu et place des\\n   identifiants ainsi que celui causé par l\'ajout d\'informations de typage, je\\n   le trouve moins lisible. De plus, il rend moins efficace la désérialisation\\n   du JSON car on compare des chaînes de caractères bien plus longues et l\'on\\n   doit constituer les hashs après la désérialisation. \\n *  Hydra : [http://www.hydra-cg.com/spec/latest/core/] permet d\'ajouter plus\\n   d\'informations de \\"type\\" par dessus JSON-LD comme les opérations que l\'on\\n   peut réaliser sur la ressource. Le fait d\'étendre JSON-LD l\'écarte de fait\\n   dans mon cas, il va plus loin, mais dans la mauvaise direction selon moi. \\n *  HAL : [http://stateless.co/hal_specification.html] je ne connaissais pas.\\n   Allez sur le site scrollez sur le premier JSON et voyez si vous avez envie de\\n   lire ce dernier. Je ne crée pas les APIs pour les robots, mais pour les\\n   humains. Pour les robots, une fois encore, il y a le fichier Swagger. \\n\\nJe n\'ai pas parlé de l\'hypermédia, mais cela va de soi. Les JSON doivent être\\nhypermédia et la concision les a exclu de cet article. Cependant, aujourd\'hui,\\nn\'importe quel explorateur de JSON sait afficher les URL où qu\'elles se trouvent\\net le fichier Swagger saura spécifier aux robots les URLs qu\'ils peuvent\\nexplorer.\\n\\nSwagger/OpenAPI sont des standards ouverts et permettent un grand nombre de\\nchoses : génération de l\'API cliente pour tout un tas de cibles, tooling et\\ngénération de documentation. C\'est le standard ouvert que j\'ai décidé d\'utiliser\\ncar il apporte une bonne séparation entre définition et données tout en laissant\\ntoute latitude au développeurs pour apporter leur propre valeur ajoutée.\\n\\nJ\'ai beaucoup de respect pour ceux qui créent les standards et je pense que tous\\nles standards valent la peine d\'être considérés. Je me réserve en revanche le\\nchoix des armes. N\'oublions pas qu\'XML est un standard, tout comme JSONX\\n[https://www.ibm.com/support/knowledgecenter/SS9H2Y_7.1.0/com.ibm.dp.doc/json_jsonx.html]\\n;). Il ne faut pas suivre bêtement un standard, mais choisir celui qui nous\\nconvient, celui qui nous permet d\'être productif. Swagger est clairement mon\\nchoix de prédilection. Il est à l\'image de JavaScript. Il va droit au but et\\nreste suffisamment simple à l\'usage. D\'ailleurs, je suis réservé sur les\\névolutions apportées par OpenAPI, j\'ai peur que cela ne soit plus le cas. Mais\\nbon, d\'ici là, peut-être qu\'un nouveau standard pointera le bout de son nez ;).\\n\\n Dessin hunoristique XKCD sur les compétition entre standards [https://imgs.xkcd.com/comics/standards.png]\\nSource: XKCD [https://xkcd.com/927/]\\n\\nEnfin, utiliser un standard n\'est même pas une obligation. Innover c\'est souvent\\ntout l\'inverse. Les exemples ne manquent pas, mais voici le dernier en date qui\\nm\'a complètement scié et m\'a pousser une fois encore à remettre en question mes\\nidées reçues :\\n\\n>  So much devs refers to practices as ugly or conceptually weird when real\\nmeasurement of systems is efficiency on the short and long run. \\n\\n— Nicolas Froidure (@nfroidure) 18 février 2017\\n[https://twitter.com/nfroidure/status/832923111355973632]\\n< Blog [/fr/blog/index.html] Please enable JavaScript to view the comments\\npowered by Disqus. [https://disqus.com/?ref_noscript] Twitter\\n[https://twitter.com/nfroidure] GitHub [https://github.com/nfroidure] NPM\\n[https://www.npmjs.org/~nfroidure] LinkedIn\\n[https://www.linkedin.com/in/nfroidure] ATOM feed [/fr/blog/index.atom] ©\\nNicolas Froidure 2012-2021"}'),doc134:JSON.parse('{"path":"contents/pages/fr/blog/notepad_plus_plus_debian_gnu_linux.html","title":"Installer/utiliser Notepad++ sous Debian GNU/Linux","description":"L\'univers windows est pour moi du passé, mais Notepad++ reste un must-have sans lequel coder serait bien moins sympa. Découvrez comment profiter de ce logiciel sous Linux.","shortTitle":"Notepad++ sous Debian","shortDesc":"Voir la marche à suivre pour profiter de Notepad++ sous Linux","contents":"  LOGO INSERT AFTER [/IMAGES/LOGO.SVG] [/FR/INDEX.HTML]\\nAccueil [/fr/index.html] Home [/en/index.html]  *  Accueil [/fr/index.html] \\n *  Blog [/fr/blog/index.html] \\n *  Projets [/fr/projets.html] \\n *  À propos [/fr/a_propos.html] \\n\\nINSTALLER/UTILISER NOTEPAD++ SOUS DEBIAN GNU/LINUX\\n⚠ Attention: Cet article est ancien et je n\'utilise plus Notepad++ depuis\\nlongtemps. L\'éditeur en lui même vaut probablement encore le coup sous Windows,\\nmais je ne vous recommande pas de l\'utiliser sous GNU/Linux vu les alternatives\\nqui existent dont VSCode [ma_config_vscode.html] que j\'utilise maintenant et qui\\nfonctionne d\'ailleurs également sous Windows et Mac.\\n\\nL\'univers windows est pour moi du passé, mais Notepad++ reste un must-have sans\\nlequel coder serait bien moins sympa. Découvrez comment profiter de ce logiciel\\nsous Linux.\\n\\nNotepad++ est selon moi le meilleur éditeur de code de tous les temps. Bien-sûr\\nce n\'est pas un IDE complet qui fait le café, mais l\'avantage est qu\'il démarre\\nau quart de tour, on code sans attendre. De plus, Notepad++ offre de nombreuses\\nfonctionnalités facilement accessibles comme voir le code de deux fichiers\\nsimultanément, ou d\'un seul cloné dans l\'autre vue. De nombreux plugins sont\\ndisponibles et les fonctionnalités les plus utilisées sont immédiatement\\naccessibles. Les raccourcis clavier son intuitifs et la navigation clavier est\\nun pur bonheur. Enfin, il permet de capturer une action pour la rejouer sur\\nplusieurs fichiers/lignes.\\n\\n Notepad++ sous Debian GNU/Linux [/images/capture-notepad.png]\\n\\nBref, c\'est pour cela que lors de mon passage à Debian GNU/Linux, j\'ai\\nimmédiatement commencé l\'installation de Notepad++. Voici la marche à suivre :\\n\\nINSTALLATION : WINE EST VOTRE AMI\\nWine est un logiciel qui permet d\'exécuter des programmes windows sous Linux.\\nPour l\'installer, il suffit de taper la commande suivante dans une console\\nadministrateur :\\n\\nroot@production:/# aptitude install wine\\n\\nVous pouvez aussi utiliser le gestionnaire de paquet : Système > Administration\\n> Gestionnaire de paquets Synaptics.\\n\\nUne fois cela fait, il vous suffit de vous rendre sur le site officiel de\\nNotepad++ [http://notepad-plus-plus.org](vous pouvez faire une donation) pour\\ntélécharger le programme. A la fin du téléchargement, vous devriez normalement\\npouvoir installer le logiciel avec Wine par un simple double clic. La procédure\\nd\'installation dure quelques minutes en fonction de votre matériel et Notepad++\\nest prêt à l\'emploi.\\n\\nUTILISATION : WINE EST VOTRE MEILLEUR AMI, SSHFS AUSSI !\\nLorsque j\'ai commencé à utiliser Notepad++, je m\'attendais à avoir des problèmes\\nde stabilité, des fonctionnalités manquantes etc... C\'est avec grand plaisir que\\nj\'ai découvert que Wine est un excellent logiciel, tout quasiment est disponible\\n: copier/coller, drag n\' drop...\\n\\nLe seul problème que j\'ai rencontré est que j\'ai un serveur sur lequel je me\\nconnectais en SSH grâce à l\'interface graphique de Debian. Malheureusement, il\\nm\'a été impossible d\'accéder à ces fichiers avec Notepad++. J\'ai contourné le\\nproblème en installant l\'excellent SSHFS.\\n\\nSSHFS est un outil basé sur la librairie Fuse qui permet de wrapper un protocole\\npour le faire passer pour un système de fichiers aux yeux de Linux. Pour\\ninstaller SSHFS :\\n\\nroot@production:/# aptitude install sshfs \\n\\nPuis, pour monter un système de fichiers, cela se passe dans un shell\\nutilisateur :\\n\\n\\nnfroidure@production:/# mkdir /home/nfroidure/Bureau/Server && sshfs root@server:/home/ /home/nfroidure/Bureau/Server \\n\\nBien sûr, le mkdir n\'est à faire qu\'une seule fois à moins que vous supprimiez\\nle fichier en même temps que vous démontez le système de fichiers. Une fois le\\nsystème de fichiers monté, il est accessible comme un lecteur de disque sous\\nWine. Pour démonter le système de fichiers, un simple :\\n\\n\\nnfroidure@production:/# fusermount -u /home/nfroidure/Bureau/Server\\n\\nSi vous avez besoin quasi systématiquement de monter ce système de fichier, vous\\npouvez utiliser l\'outil Système > Préférences > Applications au démarrage pour\\nentrer la ligne de commande qui sera exécuté à chaque démarrage de votre session\\nutilisateur. Bien-sûr, dans ce genre de cas, mieux vaut utiliser\\nl\'authentification par clé publique/privée mais ce n\'est pas le sujet de cet\\narticle.\\n\\nEnfin, le clic-droit sur un onglet n\'affiche pas l\'habituel menu contextuel\\npermettant par exemple de déplacer/cloner un fichier vers l\'autre vue. J\'ai\\ndécouvert quasiment par erreur que glisser déposer l\'onglet dans l\'espace\\nd\'édition permet d\'afficher ce menu contextuel.\\n\\nFinalement je n\'ai eu qu\'un seul problème non-résolu, la fonction pratique de\\nNotepad++ consistant à prévenir lorsqu\'un fichier ouvert dans Notepad++ a été\\nédité en dehors cause un bug qui ne se résout que par la fermeture manuelle du\\nprogramme (kill). Autant dire qu\'il ne vaut mieux pas lire vos fichiers de log\\navec Notepad++ :D.\\n\\nCONCLUSION\\nCe qui est valable ici pour Debian l\'est tout autant pour les distributions\\nbasées sur Debian (Ubuntu par exemple), voire même d\'autres distributions en\\nchangeant les commandes concernant le gestionnaire de paquets par celles de\\nvotre distribution préférée.\\n\\nVous n\'avez plus aucune excuse pour passer à Debian maintenant que votre éditeur\\nde code préféré est disponible ! Vous utilisez Notepad++ sous Linux ? Laissez\\nmoi savoir comment vous l\'utilisez ou vos petites astuces pour une meilleure\\nutilisation, ça se passe dans les commentaires !\\n\\n< Blog [/fr/blog/index.html] Please enable JavaScript to view the comments\\npowered by Disqus. [https://disqus.com/?ref_noscript] Twitter\\n[https://twitter.com/nfroidure] GitHub [https://github.com/nfroidure] NPM\\n[https://www.npmjs.org/~nfroidure] LinkedIn\\n[https://www.linkedin.com/in/nfroidure] ATOM fe